import React from 'react';
import styled from 'styled-components';
import {setFlex} from '../../utilities';

const SlideTwo = ({className}) => {
  return (
    <div className={className}>
      <h3>SLIDE TWO</h3>
    </div>
  );
}

const STwo = styled(SlideTwo)`
  ${setFlex()};
  color: white;
  width: 90%;
  height: 70vh;
  font-size: 4rem;
  background-image: linear-gradient('#43B0AF','#504A9E');
  background-color: red;
`;

export default STwo;
